var title_f14_3_14396="Stages of vitamin D deficiency rickets";
var content_f14_3_14396=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F86780&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F86780&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Stages of vitamin D deficiency rickets",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup span=\"6\" width=\"16%\">",
"     </colgroup>",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Stage",
"       </td>",
"       <td class=\"subtitle1\">",
"        Serum calcium (Ca)",
"       </td>",
"       <td class=\"subtitle1\">",
"        Serum inorganic phosphorus (iP)",
"       </td>",
"       <td class=\"subtitle1\">",
"        Parathyroid hormone (PTH)",
"       </td>",
"       <td class=\"subtitle1\">",
"        Mechanisms",
"       </td>",
"       <td class=\"subtitle1\">",
"        Radiologic and clinical findings of rickets",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td class=\"centered\">",
"        1",
"       </td>",
"       <td class=\"centered\">",
"        Low or normal",
"       </td>",
"       <td class=\"centered\">",
"        Normal",
"       </td>",
"       <td class=\"centered\">",
"        Normal or elevated",
"       </td>",
"       <td class=\"centered\">",
"        Vitamin D deficiency causes impaired intestinal absorption of calcium",
"       </td>",
"       <td class=\"centered\">",
"        None, or osteopenia only",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td class=\"centered\">",
"        2",
"       </td>",
"       <td class=\"centered\">",
"        Normal",
"       </td>",
"       <td class=\"centered\">",
"        Low",
"       </td>",
"       <td class=\"centered\">",
"        Elevated",
"       </td>",
"       <td class=\"centered\">",
"        Elevated PTH mobilizes calcium from bone, retains calcium at the kidney, and promotes production of 1,25(OH)",
"        <sub>",
"         2",
"        </sub>",
"        D",
"       </td>",
"       <td class=\"centered\">",
"        Clinically apparent rickets (radiographic and/or physical findings in the skeleton)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"centered\">",
"        3",
"       </td>",
"       <td class=\"centered\">",
"        Low",
"       </td>",
"       <td class=\"centered\">",
"        Low",
"       </td>",
"       <td class=\"centered\">",
"        Very elevated",
"       </td>",
"       <td class=\"centered\">",
"        Serum calcium falls as hyperparathyroidism is unable to compensate for impaired intestinal calcium absorption. Hyperparathyroidism may also lead to aminoaciduria and hyperphosphaturia.*",
"       </td>",
"       <td class=\"centered\">",
"        Severe radiographic and physical signs of rickets",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     1,25(OH)",
"     <sub>",
"      2",
"     </sub>",
"     D: 1,25 dihdroxyvitamin D.",
"     <br/>",
"     * Urinary phosphate is inappropriately high relative to the low levels of phosphate in the blood (ie, the renal",
"     <strong>",
"      clearance",
"     </strong>",
"     of phosphate is elevated), but actual",
"     <strong>",
"      concentrations",
"     </strong>",
"     of phosphate in the urine may not be elevated.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
