var title_f14_3_14397="Precaution requirements after treatments with 131-I hyperthyroid";
var content_f14_3_14397=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ENDO%2F74105&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ENDO%2F74105&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Examples of precaution requirements after treatments with 131-I: Hyperthyroidism*",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\" rowspan=\"2\">",
"        &nbsp;",
"       </td>",
"       <td class=\"subtitle1\" colspan=\"4\">",
"        mCi (MBq) administered",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2\">",
"        10",
"        <br/>",
"        (370)",
"       </td>",
"       <td class=\"subtitle2\">",
"        15",
"        <br/>",
"        (555)",
"       </td>",
"       <td class=\"subtitle2\">",
"        20",
"        <br/>",
"        (740)",
"       </td>",
"       <td class=\"subtitle2\">",
"        30",
"        <br/>",
"        (1110)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"5\">",
"        Restricted periods",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"5\">",
"        <em>",
"         Nighttime restrictions",
"        </em>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Sleep in a separate (6-feet separation) bed from adults for days",
"        <sup>",
"         &bull;",
"        </sup>",
"        shown.",
"       </td>",
"       <td>",
"        3",
"       </td>",
"       <td>",
"        6",
"       </td>",
"       <td>",
"        8",
"       </td>",
"       <td>",
"        11",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Sleep in a separate bed from pregnant partners, infant, or child for days shown.",
"       </td>",
"       <td>",
"        15",
"       </td>",
"       <td>",
"        18",
"       </td>",
"       <td>",
"        20",
"       </td>",
"       <td>",
"        23",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"5\">",
"        <em>",
"         Daytime restrictions",
"        </em>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        You may return to work after days shown.",
"       </td>",
"       <td>",
"        1",
"       </td>",
"       <td>",
"        1",
"       </td>",
"       <td>",
"        2",
"       </td>",
"       <td>",
"        5",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Maximize your distance (6 feet) from children and pregnant women for days shown.",
"       </td>",
"       <td>",
"        1",
"       </td>",
"       <td>",
"        1",
"       </td>",
"       <td>",
"        2",
"       </td>",
"       <td>",
"        5",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Avoid extended time in public places for days shown.",
"       </td>",
"       <td>",
"        1",
"       </td>",
"       <td>",
"        1",
"       </td>",
"       <td>",
"        1",
"       </td>",
"       <td>",
"        3",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"5\">",
"        Duration of safe travel by public transportation (bus, air, etc)",
"        <sup>",
"         &Delta;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"5\">",
"        <em>",
"         Travel time (hours) without exceeding regulatory dose limit",
"        </em>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Day",
"        <sup>",
"         &bull;",
"        </sup>",
"        0 (beginning with treatment)",
"       </td>",
"       <td>",
"        5.9",
"       </td>",
"       <td>",
"        3.9",
"       </td>",
"       <td>",
"        2.9",
"       </td>",
"       <td>",
"        2.0",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Day 1",
"       </td>",
"       <td>",
"        9.2",
"       </td>",
"       <td>",
"        6.1",
"       </td>",
"       <td>",
"        4.6",
"       </td>",
"       <td>",
"        3.1",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Day 2",
"       </td>",
"       <td>",
"        13.0",
"       </td>",
"       <td>",
"        8.7",
"       </td>",
"       <td>",
"        6.5",
"       </td>",
"       <td>",
"        4.3",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Day 3",
"       </td>",
"       <td>",
"        -",
"       </td>",
"       <td>",
"        10.6",
"       </td>",
"       <td>",
"        8.0",
"       </td>",
"       <td>",
"        5.3",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    Examples should be modified to meet local and specific patient needs. These examples are based on dose rate of 0.17 mrem h",
"    <sup>",
"     -1",
"    </sup>",
"    mCi",
"    <sup>",
"     -1",
"    </sup>",
"    at 1 m, 500 mrem per year for family member and caregiver, 100 mrem for pregnant women, children, and the public, and occupancy factors for adults of 0.25 except for sleeping 0.33. Resumption of sleeping with a partner assumes a distance of 0.3 m.",
"    <div class=\"footnotes\">",
"     * Assumes 50 percent uptake by thyroid, with effective T",
"     <sub>",
"      1/2",
"     </sub>",
"     of about 5 days.",
"     <br>",
"      <span class=\"bullet\">",
"       &bull;",
"      </span>",
"      Day = 24-hour cycle.",
"      <br>",
"       &Delta; Assumes 100 mrem limit and 0.3 m distance.",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: The American Thyroid Association Taskforce on Radioiodine Safety. Radiation Safety in the Treatment of Patients with Thyroid Diseases by Radioiodine 131-I: Practice Recommendations of the American Thyroid Association. Thyroid 2011; 21:335. Copyright &copy; 2011 Mary Ann Liebert Publishers.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
